export const ExtractPerson = (
  member,
  personName,
  personVorname,
  personGebDat,
  personSex,
  personStrasse,
  personPLZ,
  personOrt,
  personTelFestnetz,
  personTelMobil,
  personTelEmail,
  personStatus,
  personStatusDatum,
  personBank,
  personIBAN,
  personBIC
) => {
  for (const property in member) {
    switch (String(property)) {
      case "pers_name":
        personName = member[property];
        break;
      case "pers_vorname":
        personVorname = member[property];
        break;
      case "pers_geburtsdatum":
        personGebDat = member[property];
        break;
      case "pers_gender":
        personSex = member[property];
        break;
      case "pers_strasse":
        personStrasse = member[property];
        break;
      case "pers_plz":
        personPLZ = member[property];
        break;
      case "pers_ort":
        personOrt = member[property];
        break;
      case "pers_telefon_privat":
        personTelFestnetz = member[property];
        break;
      case "Pers_TelefonMobil":
        personTelMobil = member[property];
        break;
      case "pers_email":
        personTelEmail = member[property];
        break;
      case "pers_status":
        personStatus = member[property];
        break;
      case "pers_status_datum":
        personStatusDatum = member[property];
        break;
      case "pers_bank":
        personBank = member[property];
        break;
      case "pers_iban":
        personIBAN = member[property];
        break;
      case "pers_bic":
        personBIC = member[property];
        break;
      default:
        //console.log("Feld nicht zugewiesen");
        break;
    }
  }
  return {
    personName,
    personVorname,
    personGebDat,
    personSex,
    personStrasse,
    personPLZ,
    personOrt,
    personTelFestnetz,
    personTelMobil,
    personTelEmail,
    personStatus,
    personStatusDatum,
    personBank,
    personIBAN,
    personBIC,
  };
};
